#top-navbar--wrap {
  position: relative;
  z-index: 999;
  
  .top-navbar {
    height: 80px;
    background: white;
    border-bottom: solid 1px #eeeeee;

    .top-navbar__hamburger {
      display: none;
    }
    

    .top-navbar__container{
      margin-top: 0px;
    }

    .top-navbar__brand {
      img {
        width: 130px;
        margin-right: 20px;
      }
    }

    .top-navbar__nav {
      font-size: 20px;
      font-weight: 600;
      margin-right: auto;
      a {
        color: rgb(87, 87, 87);
        margin-right: 10px;
      }
      a:hover {
        color: rgb(89, 203, 248);
      }
      .active {
        color: rgb(89, 203, 248);
        background: none;
      }      
    }
  }

  .top-navbar__etc{
    display: flex;  
    flex-direction: row;  
    flex : 0 0 auto;
    align-items: center; 
    width:auto; 
  
    .top-navbar__search--wrap{
      position: relative;
      margin-right: 15px;
      
      .top-navbar__search{   
        font-size: 15px;
        font-weight: 500;
        color: rgb(65, 65, 65);
        width: 250px;
        height: 40px;
        border: solid #dbdbdb 1px;
        border-radius: 3px;
        box-sizing: border-box;
        padding: 10px 10px 10px 33px;
    
        &:hover {
          background-color: rgb(238 , 238, 238);
        }
        &::placeholder{
          color: #c0c0c0;
          text-align: left;
        }
      }
      
      .top-navbar__search--icon{
        position : absolute;
        top: 13px;
        left: 10px;
        width : 15px;
        opacity: 0.6;
      }
    }

    .top-navbar__cart-wrap{
      width: auto;  
    }
  
    .top-navbar__cart { 
      width: 25px;
      cursor: pointer;
      margin-right: 10px;
    }

    .top-navbar__etc-nav{    
      a {
        color: rgb(83, 83, 83);   
        font-weight: 600;
      }
      a:hover {
        color: rgb(89, 203, 248);
      }
      .active {
        color: rgb(89, 203, 248);
        background: none;
      } 
    }
  }
}

